import React, { useEffect, useState } from "react";

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const response = await fetch(
          "https://qa-uaesaas-api.instapract.ae/web/api/doctor/doc-list",
          {
            method: "POST",
            headers: {
              "Content-Type": "application/json",
              APPID: "Gem3s12345",
              Authorization: `Bearer ${token}`,
            },
            body: JSON.stringify({}),
          }
        );

        const data = await response.json();
        console.log("Doctors List API Response:", data);

        if (response.ok && Array.isArray(data.data)) {
          setDoctors(data.data);
        } else {
          setDoctors([]);
        }
      } catch (error) {
        console.error("Error fetching doctor list:", error);
      }
    };

    if (token) {
      fetchDoctors();
    } else {
      console.warn("No token found in localStorage.");
    }
  }, [token]);

  const getProfilePic = (url) => {
    if (!url) return "https://cdn-icons-png.flaticon.com/512/387/387561.png"; // fallback image
    return url.startsWith("http")
      ? url
      : `https://qa-uaesaas-api.instapract.ae${url}`;
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>
      {doctors.length === 0 ? (
        <p className="text-gray-500">No doctors found.</p>
      ) : (
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
          {doctors.map((doc, index) => (
            <div
              key={index}
              className="p-4 border rounded-lg shadow-md flex items-center space-x-4"
            >
              <img
                src={getProfilePic(doc.profile_pic)}
                alt={doc.name}
                className="w-16 h-16 rounded-full object-cover"
              />
              <div>
                <h3 className="text-lg font-semibold">{doc.name}</h3>
                <p className="text-sm text-gray-600">
                  {doc.specialty?.[0]?.name || "No Specialty"}
                </p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default DoctorList;
